// ASSEMBLAGE PARTIES FENETRE : la fenetre est constituee de trois parties Panel Nord : boutons ; Sud : boutons; Centre: zone de zoneDessin
    private void mise_en_page(int maxX, int maxY) {
        //--------------------------------------------------------------------
        // insertion boutons du haut
        this.p1 = new JPanel(new GridLayout());

        //--------------------------------------------------------------------
        // insertion boutons du bas
        this.p2 = new JPanel(new GridLayout());
        ajouteBouton("Effacer", this.p2);
        ajouteBouton("Quitter", this.p2);

        //--------------------------------------------------------------------
        // zone de dessin
        this.zoneDessin = new JPanel();
        this.zoneDessin.setSize(maxX, maxY);
        this.zoneDessin.setPreferredSize(new Dimension(maxX, maxY));

        //--------------------------------------------------------------------
        // on assemble le tout dans le fentre principale
        this.getContentPane().add(this.p1, "North");  // on ajoute le panel en haut de la fenetre frame
        this.getContentPane().add(this.zoneDessin, "Center");  // panel pour zoneDessiner au milieu
        this.getContentPane().add(this.p2, "South");  // on ajoute le panel en bas

        addMouseListener(this);           // on veut gerer les evenements des souris

        pack();
        setVisible(true);
    }

    // AFFICHAGE A L ECRAN : tout ce qui est dans le paint() sera à l'ecran   
    public void paint(Graphics g) {
        this.p1.repaint();  // on redessine les boutons hauts
        this.p2.repaint();  // on redessine les boutons bas

        g = this.zoneDessin.getGraphics(); // on recupere le contexte graphique du panel de dessin

        // ICI ON LANCE LE DESSIN DU QUADTREE----------------------------
        afficher(this.arb, g, 100, 100, taille);
        //---------------------------------------------------------------
    }

    /**
     * Methode recursive permettant de dessiner les rectangles selon ce qui est
     * present dans la variable A
     *
     * @param A arbreQT
     * @param g
     * @param x coin superieur gauche du rectangle de l'image
     * @param y
     * @param taille du rectangle a dessiner
     */
    public void afficher(ArbreQT A, Graphics g, int x, int y, int taille) {
        
        //condition d'arrêt : on a un carré blanc ou noir
        if (A instanceof Blanc) {
            g.setColor(Color.white);
            g.fillRect(x, y, taille, taille);
        } else if (A instanceof Noir) {
            g.setColor(Color.black);
            g.fillRect(x, y, taille, taille);
        
        //sinon
        } else if(A instanceof AQTCons) {
            //on fait du transtypage car sinon on a des erreurs
            AQTCons B = (AQTCons) A ;
            //(a,b) est le point au centre du carré actuel
            int a = (int) x+taille/2 ;
            int b = (int) y+taille/2 ;
            //on effectue la même opération sur les quatres carrés obtenus lors de la sudivision du carré actuel
            //la taille de chaque nouveau carré est celle du précédent divisé par deux.
            afficher(Repr.getRef(B.getI1()), g, x, y, (int) taille/2 + taille%2);
            afficher(Repr.getRef(B.getI2()), g, a, y, (int) taille/2 + taille%2);
            afficher(Repr.getRef(B.getI3()), g, x, b, (int) taille/2 + taille%2);
            afficher(Repr.getRef(B.getI4()), g, a, b, (int) taille/2 + taille%2);
        }
    }

